import React from "react";

export default function MovieCard({ movieData }) {
  console.log(movieData.map((movie) => movie.Title));

  return movieData.map((movie) => {
    return (
      <div className="card">
        <div>
          <img src={movie.Poster} alt="" />
        </div>
      </div>
    );
  });
}
